import "./pastwalkrequest.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faArrowRightLong } from '@fortawesome/free-solid-svg-icons';

function PastWalkRequest( { from, to } ) {
    return (
        <div class="pastWalkRequest">
            <p>{from}<FontAwesomeIcon icon={faArrowRightLong} /></p><p class="destination">{to}</p>
        </div>
    )
}

export default PastWalkRequest;
